import { BrowserRouter as Router, Switch, 
  Route, Redirect,} from "react-router-dom";

function App() {
  return (

    <>
    return (
    <>

      <Router>
        <Switch>

          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/contact" component={ContactUs} />

        </Switch>
      </Router>
    </>
  );
      <Navbar />
